css:
@-moz-document domain("altag.ru")
{
  .main_container .header{
    height: 210px;
    width:1366px;
    background:url(https://i.imgur.com/vJsT0WY.png);
    padding:0px;
    display: table-cell;
    vertical-align: bottom;
}
.main_container .header .menu .item{
    border:0px solid black;
    padding:1px 10px 3px;
    text-align: center;
    float: left;
    background-color: rgba(0, 146, 71, 1);
}
.main_container .header .menu .item a{
    text-decoration:none;
    color:#fff;
}
.main_container .header .menu #select{
    background-color: #007C3C;
    color:#fff;
}
}
